import React from "react";

function Footer() {
  return (
    <div>
      <footer>
        <div className="copyRight">
          <div className="footer-top">
            <i className="fa-copyright"></i>
            <span>Copyright 2020, OAI</span>
          </div>
          <div className="socialMedia">
              <span className="each-icon">Follow Us </span>
              <span className="each-icon">@FB</span>
              <span className="each-icon">@TW</span>
              <span className="each-icon">@IG</span>
          </div>
        </div>
      </footer>
    </div>
  );
}
export default Footer;
